import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      weather: [2, 3, 4],
      number: 0,
    }; // end constructor
  }

  componentDidMount() {
    // Fetch Function Goes here
    fetch(
      "https://api.openweathermap.org/data/2.5/weather?q=alameda&appid=5641904b9f9d3a2b1751db682fa354ff"
    )
      .then((response) => response.json())
      .then((users) => this.setState({ weather: users }));

    const a = [1, 2, 3];
    console.log(this.setState.weather);
  }
  //https://api.openweathermap.org/data/2.5/weather?q=alameda&appid=5641904b9f9d3a2b1751db682fa354ff

  changeDescription = () => {
    const a = [12, 13, 15];
    this.setState({ number: this.state.number + 1 });
  };

  render() {
    return (
      <div className="App">
        <input type="text" />
        <button onClick={this.changeDescription}> Search</button>
        {this.state.number}
        {this.state.weather}
      </div>
    );
  }
} // End Class

export default App;
